const API_URL = 'https://taylorswiftapi.herokuapp.com/get';

function App() {
  return (
    <div className="container">
      <div className='bg-white text-purple-800 p-10 rounded-lg shadow-md'>
        <h2 className='text-2xl'>
        This is where we're going to have the question.
        </h2>
      </div>
      <div className='mt-4 space-x-4'>
        <button className="bg-white w-1/2 p-4 text-purple-800 font-semibold">Answer 1</button>
        <button className="bg-white w-1/2 p-4 text-purple-800 font-semibold">Answer 2</button>
        <button className="bg-white w-1/2 p-4 text-purple-800 font-semibold">Answer 3</button>
        <button className="bg-white w-1/2 p-4 text-purple-800 font-semibold">Answer 4</button>
      </div>
    </div>
  );
}

export default App;
